import React, { useEffect, useState } from 'react';
import {
  Container,
  Typography,
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  Paper,
  Button,
  TextField,
  Alert,
  CircularProgress,
  Dialog,
  DialogTitle,
  DialogContent,
  DialogActions,
  Checkbox,
} from '@mui/material';
import axiosInstance from '../api/axiosInstance';
import Header from '../components/Header';

const UploadedFilesPage = () => {
  const [files, setFiles] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');
  const [sharedWithDialog, setSharedWithDialog] = useState(false);
  const [sharedUsers, setSharedUsers] = useState([]);
  const [openShareDialog, setOpenShareDialog] = useState(false);
  const [selectedFileId, setSelectedFileId] = useState(null);
  const [shareDetails, setShareDetails] = useState({
    user_id: '',
    view_permission: false,
    download_permission: false,
    expiration: 24, // default expiration in hours
  });

  useEffect(() => {
    const fetchUploadedFiles = async () => {
      try {
        const response = await axiosInstance.get('/api/all-files/');
        setFiles(response.data.files);
      } catch (err) {
        setError('Failed to fetch uploaded files.');
      } finally {
        setLoading(false);
      }
    };
    fetchUploadedFiles();
  }, []);

  const handleDownload = async (fileId) => {
    try {
      const response = await axiosInstance.get(`/api/access/${fileId}/`, {
        responseType: 'blob',
      });
      const url = window.URL.createObjectURL(new Blob([response.data]));
      const link = document.createElement('a');
      link.href = url;
      link.setAttribute('download', 'file.encrypted');
      document.body.appendChild(link);
      link.click();
    } catch (err) {
      alert('Failed to download file.');
    }
  };

  const openShareDialogHandler = (fileId) => {
    setSelectedFileId(fileId);
    setOpenShareDialog(true);
  };

  const handleShareFile = async () => {
    try {
      const response = await axiosInstance.post(`/api/share/${selectedFileId}/`, shareDetails);
      alert(response.data.message || 'File shared successfully.');
      setOpenShareDialog(false);
      setShareDetails({
        user_id: '',
        view_permission: false,
        download_permission: false,
        expiration: 24,
      });
    } catch (err) {
      alert('Failed to share file. Please try again.');
    }
  };

  const handleDialogClose = () => {
    setOpenShareDialog(false);
    setShareDetails({
      user_id: '',
      view_permission: false,
      download_permission: false,
      expiration: 24,
    });
  };

  const handleViewSharedWith = async (fileId) => {
    try {
      setSelectedFileId(fileId);
      const response = await axiosInstance.get(`/api/shared-with/${fileId}/`);
      setSharedUsers(response.data.shared_users || []);
      setSharedWithDialog(true);
    } catch (err) {
      alert('Failed to fetch shared users.');
    }
  };

  const handleRevokeAccess = async (username) => {
    try {
      await axiosInstance.post(`/api/revoke/${selectedFileId}/`, {
        username,
      });
      alert('Access revoked successfully.');
      setSharedUsers((prev) => prev.filter((user) => user.username !== username));
    } catch (err) {
      alert('Failed to revoke access.');
    }
  };

  return (
    <>
      <Header />
      <Container maxWidth="md" sx={{ mt: 10 }}>
        <Typography variant="h4" gutterBottom>
          Uploaded Files
        </Typography>

        {loading ? (
          <CircularProgress />
        ) : error ? (
          <Alert severity="error">{error}</Alert>
        ) : (
          <TableContainer component={Paper} sx={{ mt: 4 }}>
            <Table>
              <TableHead>
                <TableRow>
                  <TableCell>File Name</TableCell>
                  <TableCell>Uploaded At</TableCell>
                  <TableCell>Actions</TableCell>
                </TableRow>
              </TableHead>
              <TableBody>
                {files.map((file) => (
                  <TableRow key={file.id}>
                    <TableCell>{file.file_name}</TableCell>
                    <TableCell>{new Date(file.uploaded_at).toLocaleString()}</TableCell>
                    <TableCell>
                      <Button
                        variant="contained"
                        color="primary"
                        onClick={() => handleDownload(file.id)}
                      >
                        Download
                      </Button>
                      <Button
                        variant="outlined"
                        color="secondary"
                        sx={{ ml: 2 }}
                        onClick={() => openShareDialogHandler(file.id)}
                      >
                        Share
                      </Button>
                      <Button
                        variant="text"
                        color="info"
                        sx={{ ml: 2 }}
                        onClick={() => handleViewSharedWith(file.id)}
                      >
                        Shared With
                      </Button>
                    </TableCell>
                  </TableRow>
                ))}
              </TableBody>
            </Table>
          </TableContainer>
        )}

        {/* Share File Dialog */}
        <Dialog open={openShareDialog} onClose={handleDialogClose}>
          <DialogTitle>Share File</DialogTitle>
          <DialogContent>
            <TextField
              label="User ID"
              fullWidth
              value={shareDetails.user_id}
              onChange={(e) => setShareDetails({ ...shareDetails, user_id: e.target.value })}
              sx={{ mt: 2 }}
            />
            <TextField
              label="Expiration (hours)"
              fullWidth
              type="number"
              value={shareDetails.expiration}
              onChange={(e) => setShareDetails({ ...shareDetails, expiration: e.target.value })}
              sx={{ mt: 2 }}
            />
            <div style={{ display: 'flex', justifyContent: 'space-between', marginTop: 16 }}>
              <Button
                variant={shareDetails.view_permission ? 'contained' : 'outlined'}
                onClick={() =>
                  setShareDetails({
                    ...shareDetails,
                    view_permission: !shareDetails.view_permission,
                  })
                }
              >
                {shareDetails.view_permission ? 'View Enabled' : 'Enable View'}
              </Button>
              <Button
                variant={shareDetails.download_permission ? 'contained' : 'outlined'}
                onClick={() =>
                  setShareDetails({
                    ...shareDetails,
                    download_permission: !shareDetails.download_permission,
                  })
                }
              >
                {shareDetails.download_permission ? 'Download Enabled' : 'Enable Download'}
              </Button>
            </div>
          </DialogContent>
          <DialogActions>
            <Button onClick={handleDialogClose} color="secondary">
              Cancel
            </Button>
            <Button onClick={handleShareFile} color="primary">
              Share
            </Button>
          </DialogActions>
        </Dialog>

        {/* Shared With Dialog */}
        <Dialog open={sharedWithDialog} onClose={() => setSharedWithDialog(false)}>
          <DialogTitle>Shared With</DialogTitle>
          <DialogContent>
            {sharedUsers.length > 0 ? (
              sharedUsers.map((user) => (
                <div
                  key={user.username}
                  style={{
                    display: 'flex',
                    alignItems: 'center',
                    justifyContent: 'space-between',
                    marginTop: 16,
                  }}
                >
                  <Typography>
                    {user.username} ({user.email || 'No email available'})
                  </Typography>
                  <Button
                    color="error"
                    variant="outlined"
                    onClick={() => handleRevokeAccess(user.username)}
                  >
                    Revoke Access
                  </Button>
                </div>
              ))
            ) : (
              <Typography>No users have access to this file.</Typography>
            )}
          </DialogContent>
          <DialogActions>
            <Button onClick={() => setSharedWithDialog(false)}>Close</Button>
          </DialogActions>
        </Dialog>
      </Container>
    </>
  );
};

export default UploadedFilesPage;
